description:
Verenigde Staten
Actie / Thriller
86 minuten

goed

met Wesley Snipes, Zoe Bell en Robert Davi

CIA-agent Marcus (Snipes) werkt undercover als bodyguard voor een wapenhandelaar, die in dienst is bij de baas van een 
hedgefonds, met als doel hem en zijn baas uit te schakelen. Wanneer een paar corrupte CIA-agenten het voorzien hebben op het 
geld van deze financier, moet Marcus het opnemen tegen zijn collega's.
